package internal

import (
	"fmt"
	"net/http"
)

var Root_Pausing = http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {

	// http.Error(w, "this hubs' paused, click the duck to try to unpause it", http.StatusOK)
	w.Header().Set("Content-Type", "text/html; charset=utf-8")

	fmt.Fprint(w, pausing_html)

})

var pausing_html = `
<!DOCTYPE html>
<html>
<head>
	<style>
		body {
			background-color: black;
			color: white;
			display: flex;
			justify-content: center;
			align-items: center;
			height: 100vh;
			flex-direction: column;
		}
		#duckPic {
			width: 200px;
			height: 200px;
		}
	</style>
</head>
<body>
	<img id="duckPic" src="data:image/png;base64," />
	<div id="pausingText">this hubs' paused, click the duck to try to unpause it</div>

	<script>
		var clickCount = 0;
		document.getElementById('duckPic').addEventListener('click', function() {
			clickCount++;
			if (clickCount >= 5) {
				document.getElementById('pausingText').innerText = "resuming, this should take just a few minutes";
				fetch('/z/resume') 
				.then(response => response.json())
				.then(data => console.log(data))
				.catch(error => console.error('Error:', error));
			}
		});
	</script>
</body>
</html>	
`
